import { useState } from "react";

function SEND ()  {
    const [name, setName] = useState("");
    const [rent, setRent] = useState("");
    const [email, setEmail] = useState("");
    const [phone, setPhone] = useState("");
    const [coord, setCoord] = useState("");
    const [strobes, setNebr] = useState("");
    const [suriname, setStrName] = useState("");
    const [postcode, setCode] = useState("");
    const [status, setStatus] = useState("");

    const postEvent = (e) => {
        e.preventDefault();
        const data = {
            name: name,
        }
        const url = "https://testapi.photodino.de/cities/"
        fetch(url, {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify(data),
        })
        .then(response => {
            console.log("response", response);
            // eslint-disable-next-line eqeqeq
            if(response.ok){
                setName("")
            }
            }).catch(error =>{
                console.log('erreur', error)

            })
        }

        return(
            <div>
                <form onSubmit={postEvent}>

                    <div class="form-group col-lg-12" id="div_name">
                        <label class="col-form-label" for="email">Email</label>
                        <input type="text" value={rent}  placeholder="Name" class="hbb_text_box form-control" onChange={(e) => setName(e.target.value)}/>
                    </div>

                    <div class="form-group col-lg-12" id="div_rent">
                        <label class="col-form-label" for="email">Email</label>
                        <input type="text" value={rent}  placeholder="Rent" class="hbb_text_box form-control" onChange={(e) => setRent(e.target.value)}/>
                    </div>

                    <div class="w-100"/>
                    <div class="form-group col-lg-12" id="div_email">
                        <label class="col-form-label" for="email">Email</label>
                        <input type="email" value={email}  placeholder="Email" class="hbb_text_box form-control" onChange={(e) => setEmail(e.target.value)}/>
                    </div>

                    <div class="form-group col-lg-12" id="div_phone">
                        <label class="col-form-label" for="phone">Phone</label>
                        <input type="tel" value={phone} placeholder="Phone" onChange={(e) => setPhone(e.target.value)} />
                    </div>

                    <div class="form-group col-lg-12 div_street_coord">
                        <label class="col-form-label" for="street">Address <span class="d-none d-md-inline"> Coordinates</span>
                        </label>
                        <input type="number" class="hbb_text_box form-control" value={coord} placeholder="coord" onChange={(e) => setCoord(e.target.value)}/>
                    </div>

                    <div class="w-100"/>
                    <div class="form-group col-lg-12 div_street_number">
                        <label class="col-form-label" for="street">Address <span class="d-none d-md-inline"> Street Number</span>
                        </label>
                        <input type="text" class="hbb_text_box form-control" value={strobes}  placeholder="Street Number" onChange={(e) => setNebr(e.target.value)}/>
                    </div>

                    <div class="w-100"/>
                    <div class="form-group col-lg-12 div_street_name">
                        <label class="col-form-label" for="street">Address <span class="d-none d-md-inline"> Street Name</span>
                        </label>
                        <input type="text" class="hbb_text_box form-control" value={suriname} placeholder="Rent" onChange={(e) => setStrName(e.target.value)}/>
                    </div>

                    <div class="form-group col-lg-12 div_street_coord">
                        <label class="col-form-label" for="code">Code <span class="d-none d-md-inline"> Code Postal</span>
                        </label>
                        <input type="number" class="hbb_text_box form-control" value={postcode} placeholder="code postal" onChange={(e) => setCode(e.target.value)}/>
                    </div>

                    <div class="form-group col-lg-12 div_street_status">
                        <label class="col-form-label" for="status">Status <span class="d-none d-md-inline"> Status</span>
                        </label>
                        <input type="text" class="hbb_text_box form-control" value={status} placeholder="status" onChange={(e) => setStatus(e.target.value)}/>
                    </div>

                    <button class="buttonForm" type="submit">Create</button>
                </form>
                {/* <div className="messageForm">{message ? <p>{message}</p> : null}</div> */}
            </div>
        );
}

export default SEND;
